import React from 'react';
import { StyleSheet, Pressable, View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Icon from 'react-native-vector-icons/FontAwesome';

import Index from './composants/views/Index';


const Stack = createNativeStackNavigator();

function App() {
  return (
        <View style={styles.titre_menu}>
           <NavigationContainer>
              <Stack.Navigator>
                  <Icon name="bars" size={27} color="#FF8038" />
                  <Text style={styles.nom_proj}>
                      <Stack.Screen name="e-Reserva" component={Index} />
                  </Text>
                  <Icon name="ellipsis-v" size={27} color="#FF8038" />
              </Stack.Navigator>
           </NavigationContainer>
        </View>
  );
}

const styles = StyleSheet.create({
  titre_menu: {
    backgroundColor: '#0E4452',
    flexDirection: 'row',
    justifyContent: 'space-between',
    paddingHorizontal: 20,
    paddingVertical: 10
  },
  nom_proj: {
    color: "white", 
    fontSize: 22, 
    marginRight: 40,
    fontWeight: 'bold'
  }
})

export default App;
